import React from 'react';
import './RecipePage.css';

class RecipePage extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            props: this.props
        }
    }

    render() {
        return (
            <div className="tile">
                <p> {this.state.props.RecipePage} </p>

            </div>
        )
    }
}

export default RecipePage;
